import Pages from './pages/Pages';
import Data from './components/Data';
import { useState } from 'react';


function App() {
  const { productItems } = Data;

  const [cartItem, setCardItem] = useState([])
  return (
    <>
      <Router>
        <Header />
        <Routes>
          <Route path="/" exact
            element=
            {
              <Pages productItems={productItems} />
              }>
          </Route>
        </Routes>
      </Router>
    </>
  );
}

export default App;
